import React from 'react';
import styles from './Title.module.css';

const Title = ()=>{
    return (
        <div className={styles.title}>
            <p><span>T</span>he</p>
            <p><span>E</span>ntrepreneurship</p>
            <p><span>N</span>etwork</p>
        </div>
    )
}
export default Title;
